import React from "react";
import { PageMain, Helpers } from "core";
import NotificationSystem from "react-notification-system";
import PersonalInformationPage from "././personalInformationPage";
import DirectorsInformationPage from "././directorslInformationPage";
import LawyerInformationPage from "././lawyerInformationPage";
import DetailsActivityPage from "././detailsActivityPage";
import DetailsReportPage from "././detailsReportPage";
import DecriptionReportPage from "././decriptionReportPage";
import IdentityReporterPage from "././identityReporterPage";
import PosDevicePage from '././posDevicePage';
import EBankPage from '././eBankPage';
import GuildsPage from '././guildsPage';
import CompanyRegistrationPage from '././companyRegistrationPage';
import LicensingExchangesPage from '././licensingExchangesPage';
import PajhwokPage from '././pajhwokPage';
import BusinessCardsPage from '././businessCardsPage';
import FurtherInformationPage from '././furtherInformationPage';
import "../../assets/app.css";

class TabPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            tabNumber: 0,
            isLoading: false,
            updateKey: 1,
            showSubMenu:false,
        };
        this.tabNumber = props.tabNumber;
        this.pageInfo = {
            title: "بررسی تکمیلی",
            icon: "circle-plus",
        };
        this.onChangeTab = this.onChangeTab.bind(this);
        this.notificationSystem = React.createRef();
        this.tabMenu = [
            "اطلاعات شخصی اصلی موضوع گزارش",
            "اطلاعات ذینفعان / امضاداران حساب / افراد مرتبط مالی موثر/ اعضای هیئت مدیره",
            "اطلاعات وکیل",
            "جزئیات فعالیت مشکوک",
            "جزئیات گزارش",
            "شرح گزارش",
            "اطلاعات تکمیلی",
            "اطلاعات هویتی گزارش دهنده",
        ]
        this.tabSubMenu = [
            "(دستگاه POS) ابزار پذیرش",
            "اطلاعات مربوط بانکداری نوین / مجازی",
            "اصناف",
            "سامانه ثبت شرکت ها",
            "مجوز صرافی ها (بانک مرکزی)",
            "پژواک",
            "کارت بازرگانی"
        ]
    }

    onChangeTab(number) {
        let showSubMenu=this.state.showSubMenu;
        if(number==6)
        showSubMenu=!showSubMenu;
      this.setState({
        showSubMenu:showSubMenu,
          tabNumber: number,
          updateKey: this.state.updateKey + 1
      });

    }

    render() {
        return (
            <>
                <PageMain
                    title={this.pageInfo.title}
                    icon={this.pageInfo.icon}
                    isLoading={this.props.isLoading}>

                    <div className="row">
                        <div className="col-3">
                            <div className="list-group" id="list-tab" role="tablist">
                                <a className={this.state.tabNumber == 0 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(0)} data-toggle="list" role="tab">{this.tabMenu[0]}</a>
                                <a className={this.state.tabNumber == 1 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(1)} data-toggle="list" role="tab">{this.tabMenu[1]}</a>
                                <a className={this.state.tabNumber == 2 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(2)} data-toggle="list" role="tab">{this.tabMenu[2]}</a>
                                <a className={this.state.tabNumber == 3 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(3)} data-toggle="list" role="tab">{this.tabMenu[3]}</a>
                                <a className={this.state.tabNumber == 4 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(4)} data-toggle="list" role="tab">{this.tabMenu[4]}</a>
                                <a className={this.state.tabNumber == 5 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(5)} data-toggle="list" role="tab">{this.tabMenu[5]}</a>
                                <a className={this.state.tabNumber == 6 ? "list-group-item list-group-item-action active dropdown-toggle" : "list-group-item list-group-item-action dropdown-toggle"}  onClick={() => this.onChangeTab(6)}data-toggle="list" role="tab">{this.tabMenu[6]}</a>
                               {this.state.showSubMenu? 
                              <>  
                                <a className={this.state.tabNumber == 61 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(61)}data-toggle="list" role="tab">{'*'+this.tabSubMenu[0]}</a>
                                <a className={this.state.tabNumber == 62 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(62)}data-toggle="list" role="tab">{'*'+this.tabSubMenu[1]}</a>
                                <a className={this.state.tabNumber == 63 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(63)}data-toggle="list" role="tab">{'*'+this.tabSubMenu[2]}</a>
                                <a className={this.state.tabNumber == 64 ? "list-group-item list-group-item-action active" : "list-group-item list-group-item-action"}  onClick={() => this.onChangeTab(64)}data-toggle="list" role="tab">{'*'+this.tabSubMenu[3]}</a>
